import React from 'react'
import { useState, useEffect } from 'react';
export const UserAuth = (props) => {
    const [ticketData, setTicketData] = useState(null);
    const [devloperId, inputDevId] = useState(null);
    const [pass, inputPassword] = useState(null);
    const handleInputDevId = (e) => {
        inputDevId(e.target.value);
    };
    const handleInputPass = (e) => {
        inputPassword(e.target.value);
    };
    function fetch() {
        return new Promise(resolve => setTimeout(() => resolve(42), 1000));
    }
    const toggleButtonState = () => {
        fetchAPI().then(result => {
            console.log(result)
            setTicketData(result);
        });
    };
    function fetchAPI() {
        const requestOptions = {
            method: 'POST',
            headers: { 'Content-Type': 'application/json' },
            body: JSON.stringify({ devId: devloperId,password:pass}),
        };
        return fetch("http://localhost:8000/userAuth",requestOptions);
    }
    return (
        <>
            <form>
                <div className="mb-3">
                    <label for="exampleInputEmail1" className="form-label">Developer Id</label>
                    <input type="text" className="form-control" id="exampleInputEmail1" aria-describedby="emailHelp" value={devloperId} onChange={handleInputDevId}/>
                </div>
                <div className="mb-3">
                    <label for="exampleInputPassword1" className="form-label">Password</label>
                    <input type="password" className="form-control" id="exampleInputPassword1" value={pass} onChange={handleInputPass} />
                </div>
                <button type="submit" className="btn btn-primary" onClick={()=>{toggleButtonState();}}>Login</button>
            </form>
        </>
    )
}
